import React, { createRef } from 'react';

import './header-popup-window.css';


const HeaderPopupWindow = () => {

    const popupWindowRef = createRef();

    const handlePopupButtonClick = () => {
        console.log(popupWindowRef);
    }

    return (
        <div>
            <div class="upper-popup-window-hidden"></div>
            <div class="upper-popup-window" ref={popupWindowRef}>
                <div class="upper-popup-window__wrapper">
                    <p class="upper-popup-window__text">Быстрая доставка по Москве.</p>
                    <span
                        class="upper-popup-window__close-button"
                        onClick={handlePopupButtonClick}></span>
                </div>
            </div>
        </div>
    );
}

export default HeaderPopupWindow;
